import React from "react";
import { CardColumns } from "reactstrap";
import Listing from "./Listing";

const Listings = props => {

    return (
        <>

          <CardColumns>
          {
            props.listings.map((listing, index) => 
            <Listing key={index}
                     info={listing} />)
          }
          </CardColumns>
        </>
    )
}

export default Listings;
